import React from "react";
import "./Product.css";
import { Link } from "react-router-dom";

const ProductList = [
  {
    id: 1,
    img: "data:image/jpeg;base64,",
    title: "Delicious hamburger flat design",
    price: "1200",
    path: "/singleproduct",
    
  },
  {
    id: 1,
    img: "data:image/jpeg;base64,",
    title: "Delicious hamburger flat design",
    price: "1200",
  },
  {
    id: 1,
    img: "data:image/jpeg;base64,",
    title: "Delicious hamburger flat design",
    price: "1200",
  },
];

export default function Products() {
  return (
    <>
      <div
        className="Products__Container"
        style={{ border: "1px solid green" }}
      >
        <div className="Products__Wrapper" style={{ border: "1px solid blue" }}>
          {ProductList.map((data) => {
            return(
            
            <div className="Product__one" style={{ border: "1px solid red" }}>
               <Link to={data.path}> <img src={data.img} alt="Product" /> </Link>
                <Link to={data.path}> <h5>{data.title} </h5> </Link>
              <h5>Rs.{data.price}</h5>
            </div>
          
            )
          })}
        </div>
      </div>
    </>
  );
}
